import React from 'react'
import {ThemeProvider} from '@material-ui/styles'
import theme from './../../Theme/index'

const App = () => {
  return(
    <ThemeProvider theme = {theme}>
        <div className="app">
            <h1>Thống Kê Người Dùng</h1>
        </div>
    </ThemeProvider>
  )
}
export default App
